void buildPrefixArray(vector<int> &nums, vector<int> &outArray){
    int sum = 0;
    for(int i = 0 ; i < nums.size() ;i++){
        sum += nums[i];
        outArray[i] = sum;
    }//end for i
}

int subarraySum(vector<int> &nums , int k) {
    const int size = nums.size();
    vector<int> prefixArray(size);
    buildPrefixArray(nums , prefixArray);

    unordered_map<int , int> hashCache;
    for(int i = 0 ;i < size ; i++){
        int value = prefixArray[i];
        if(hashCache.find(value) == hashCache.end()){
            hashCache[value] = 1;
        }else{
            int valueCount = hashCache[value];
            hashCache[value] = valueCount + 1;
        }//end if
    }//end for i

    int count = 0;
    
    // for(int i = size - 1;i >= 0;i--){
    //     //
    //     for(int j = i; j >=0; j--){
    //         if(prefixArray[i] - prefixArray[ j] + nums[j] == k){
    //             cout << "i -> j : " << "[" << j << ", " << i << "]" <<endl;
    //             count++;
    //         }
    //     }//end for j
    // }//end for i

    return count;
}


